import React from 'react'

function BlogRelated({blog}) {
  return (
    <div className="blog_related_item">
      <img src={blog.images.url} alt="" />
      <h4 title={blog.title}>{blog.title}</h4>
    </div>
  )
}
export default BlogRelated
